package whut.inis.show.po;

public class IntroductionInfo {
	String username=null;
	String uname=null;	
	String xingbie=null;
	String xuewei=null;
	String startyear=null;
	String birthday=null;
	String address=null;
	String email=null;
	String tel=null;
	String beizhu=null;
	String fileurl=null;
String filename=null;

	public IntroductionInfo() {
		super();
		// TODO Auto-generated constructor stub
	}

	public IntroductionInfo(String username, String uname, String xingbie,
			String xuewei, String startyear, String birthday, String address,
			String email, String tel, String beizhu, String fileurl,
			String filename) {
		super();
		this.username = username;
		this.uname = uname;
		this.xingbie = xingbie;
		this.xuewei = xuewei;
		this.startyear = startyear;
		this.birthday = birthday;
		this.address = address;
		this.email = email;
		this.tel = tel;
		this.beizhu = beizhu;
		this.fileurl = fileurl;
		this.filename = filename;
	}

	public String getUsername() {
		return username;
	}

	public void setUsername(String username) {
		this.username = username;
	}

	public String getUname() {
		return uname;
	}

	public void setUname(String uname) {
		this.uname = uname;
	}

	public String getXingbie() {
		return xingbie;
	}

	public void setXingbie(String xingbie) {
		this.xingbie = xingbie;
	}

	public String getXuewei() {
		return xuewei;
	}

	public void setXuewei(String xuewei) {
		this.xuewei = xuewei;
	}

	public String getStartyear() {
		return startyear;
	}

	public void setStartyear(String startyear) {
		this.startyear = startyear;
	}

	public String getBirthday() {
		return birthday;
	}

	public void setBirthday(String birthday) {
		this.birthday = birthday;
	}

	public String getAddress() {
		return address;
	}

	public void setAddress(String address) {
		this.address = address;
	}

	public String getEmail() {
		return email;
	}

	public void setEmail(String email) {
		this.email = email;
	}

	public String getTel() {
		return tel;
	}

	public void setTel(String tel) {
		this.tel = tel;
	}

	public String getBeizhu() {
		return beizhu;
	}

	public void setBeizhu(String beizhu) {
		this.beizhu = beizhu;
	}

	public String getFileurl() {
		return fileurl;
	}

	public void setFileurl(String fileurl) {
		this.fileurl = fileurl;
	}

	public String getFilename() {
		return filename;
	}

	public void setFilename(String filename) {
		this.filename = filename;
	}

	
	
}
